import { __decorate } from "tslib";
import { Component } from '@angular/core';
let RadiografiiComponent = class RadiografiiComponent {
    constructor(radiografieService, token) {
        this.radiografieService = radiografieService;
        this.token = token;
    }
    ngOnInit() {
        this.currentUser = this.token.getUser();
        this.radiografieService.getRadiografie(this.currentUser.email).subscribe({
            next: async (response) => {
                this.radiografii = response;
                console.log(this.radiografii);
            },
            error: (error) => {
                alert(error.message);
            }
        });
    }
};
RadiografiiComponent = __decorate([
    Component({
        selector: 'app-radiografii',
        templateUrl: './radiografii.component.html',
        styleUrls: ['./radiografii.component.css']
    })
], RadiografiiComponent);
export { RadiografiiComponent };
